public boolean equals(Object obj) {
  if (obj == this) {
    return true;
  }
  if (obj != null && obj instanceof Key) {
    Key that = (Key) obj;
    return this.scheme.equals(that.scheme) && this.authority
        .equals(that.authority);
  }
  return false;
}
